:53Z', 'updated_at': '2022-04-14T22:45:51Z', 'closed_at': '2022-04-14T22:45:51Z', 'author_association': 'MEMBER', 'active_lock_reason': None, 'body': '## Describe the bug
ESBuild doesn't tree shake *Client imports

> This is probably an issue with esbuild or my configuration. I'm creating a bug report with minimal repro.

## Your environment

#### SDK version number
`@aws-sdk/client-acm@3.67.0`

#### Is the issue in the browser/Node.js/ReactNative?
Node.js

#### Details of the browser/Node.js/ReactNative version
```console
$ node -v
v16.14.2

$ ./node_modules/.bin/esbuild --version
0.14.36
```

## Steps to reproduce

```js
// bare-bones-client.mjs
import { ACMClient, ListCertificatesCommand } from "@aws-sdk/client-acm";

export const listCertificates = () => {
  const client = new ACMClient({ region: "us-west-2" });
  return client.send(new ListCertificatesCommand({}));
};
```

```js
// aggregated-client.mjs
import { ACM } from "@aws-sdk/client-acm";

export const listCertificates = () => {
  const client = new ACM({ region: "us-west-2" });
  return client.listCertificates({});
};

```

#### Observed behavior
```console
$ ./node_modules/.bin/esbuild bare-bones-client.mjs --bundle --outfile=out.js --platform=node 
  out.js  750.0kb
```

```console
$ ./node_modules/.bin/esbuild aggregated-client.mjs --bundle --outfile=out.js --platform=node 
  out.js  749.9kb
```

#### Expected behavior
I was expecting the bundle created from `bare-bones-client.mjs` to be much smaller.', 'reactions': {'url': 'https://api.github.com/repos/aws/aws-sdk-js-v3/issues/3542/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/aws/aws-sdk-js-v3/issues/3542/timeline', 'performed_via_github_app': None}}

